import { Link } from "react-router-dom"

export default function Navbar(){

    return(
        <nav className="nav">

            <Link to="\" className="homeButton">
                Home Page
            </Link>

            <ul>

                    <CustomLink to="\Upcoming" className="upButton">Upcoming Events</CustomLink>

                    <CustomLink to="\Past" className="pastbutton">Past Events</CustomLink>

                    <CustomLink to="\Contact" className="contactbutton">Contact Us</CustomLink>


                    <CustomLink to="\AboutUs" className="aboutButton">About Us</CustomLink>


            </ul>

        </nav>



    )

}

function CustomLink({href, children,...props}){

    return(
        <li>
            <Link to={to} {...props}> 
            {children}
            </Link>
        </li>

    )
}
